import './categories.css'

import React, { Component } from 'react'

export class Categories extends Component {
    constructor(props) {
        super(props)
        this.state = {
            categories: [
                {
                    key: 'all',
                    name: 'Всё'
                },
                {
                    key: 'Акустические гитары',
                    name: 'Акустические гитары'
                },
                {
                    key: 'Электрогитары',
                    name: 'Электрогитары'
                },
                {
                    key: 'Классические гитары',
                    name: 'Классические гитары'
                },
                {
                    key: 'Усилители для гитар',
                    name: 'Усилители для гитар'
                },
                {
                    key: 'Цифровое пианино',
                    name: 'Цифровое пианино'
                },
                {
                    key: 'Барабаны',
                    name: 'Барабаны'
                },
            ]
        }
    }
    render() {
        return (
        <>
       
      
        <div className="container">
      
        <span>Категории</span>
                <div className="categories">
                  
                    <button
                        onClick={() => handleCategoryClick('')}
                        className={activeCategory === '' ? 'active' : ''}
                    >
                        Все
                    </button>
                    <button
                        onClick={() => handleCategoryClick('Акустическая гитара')}
                        className={activeCategory === 'Акустические гитары' ? 'active' : ''}
                    >
                        Акустические гитары
                    </button>
                    <button
                        onClick={() => handleCategoryClick('Электрогитара')}
                        className={activeCategory === 'Электрогитары' ? 'active' : ''}
                    >
                        Электрогитары
                    </button>
                    <button
                        onClick={() => handleCategoryClick('Классическая гитара')}
                        className={activeCategory === 'Классические гитары' ? 'active' : ''}
                    >
                        Классические гитары
                    </button>
                    <button
                        onClick={() => handleCategoryClick('Усилитель для гитары')}
                        className={activeCategory === 'Усилители для гитар' ? 'active' : ''}
                    >
                        Усилители для гитар
                    </button>
                    <button
                        onClick={() => handleCategoryClick('Цифровое пианино')}
                        className={activeCategory === 'Цифровое пианино' ? 'active' : ''}
                    >
                        Цифровое пианино
                    </button>
                    <button
                        onClick={() => handleCategoryClick('Барабаны')}
                        className={activeCategory === 'Барабаны' ? 'active' : ''}
                    >
                        Барабаны
                    </button>
                </div>
        </div>
      
            </>
        )
    }
}

export default Categories;
